        position: absolute;

        z-index: 20000

    #vungle-header a {
        font-size: 1.3em;
        text-shadow: rgba(0, 0, 0, .37) 0 1px 2px;
        -webkit-transition: color 50ms ease-in-out;
        z-index: 200000

    #vungle-header.portrait-light a {
        color: #fff;
        text-shadow: rgba(0, 0, 0, .37) 0 1px 2px
    }

    #vungle-header.portrait-light a:active {
        color: #b4b4b4

    #vungle-header.portrait-dark a {
        color: rgba(126, 126, 126, 1);
        text-shadow: rgba(0, 0, 0, .2) 0 1px 2px
    }

    #vungle-header.portrait-dark a:active {
        color: rgba(54, 54, 54, 1)
    }

    #vungle-close {
        padding: 15px;
        right: 0;
        position: absolute
    }

    #vungle-footer {
        position: fixed;
        display: none;
        bottom: 0;
        z-index: 9999;
        width: 50px;
        overflow: hidden;
        pointer-events: none;
        -webkit-touch-callout: none;
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;

    }

        line-height: 20px;
        display: block
    }

        right: 0;

    }

    }

        color: rgba(126, 126, 126, .8)
    }
